I think the problem is that just declaring disp_xyz in the Mesh block will make them nonlinear variables. This being a pure fluid flow (unless I m missing something) there is no equations for them and the matrix has a lot of 0s
You d have to define them as auxiliary variables in the [AuxVariables] block.
